    dpb = [[[0, 0] for _ in range(m + 2)] for _ in range(n + 2)]
    ans = 1
    for i in range(1, n + 1):
        for j in range(1, m + 1):
            dpa[i][j][0] = max(dpa[i - 1][j][0], dpa[i][j - 1][0]) + a[i - 1][j - 1]
            dpa[n + 1 - i][m + 1 - j][1] = max(dpa[n + 2 - i][m + 1 - j][1], dpa[n + 1 - i][m + 2 - j][1]) + a[n - i][m - j]
